import re

def generate_bird_codes(bird_names):
    SPLITTER = re.compile('')

    def birdify(lst):
        if len(lst) == 1:
            return lst[0][:4]
        elif len(lst) == 2:
            return lst[0][:2] + lst[1][:2]
        elif len(lst) == 3:
            return lst[0][0] + lst[1][0] + lst[2][:2]
        elif len(lst) == 4:
            return lst[0][0] + lst[1][0] + lst[2][0] + lst[3][0]
        return ''
    return [birdify(SPLITTER.split(name)).upper() for name in bird_names]

